import React, { Component } from 'react'

export default class Data extends Component {

    constructor(props) {
      super(props)

      this.state = {
         first:[]
      }
    }


componentDidMount() { 
axios.get('https://jsonplaceholder.typicode.com/users')
.then(res=>{
    let all=res.data
    this.setState({first:all})
})
 }


  render() {
    return (
      <div>

          <h1>{this.state.first.map(d=>{d.name})}</h1>
      </div>
    )
  }
}


